import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroBg from "../images/hero-bg.jpg";

const PartnershipSearch = () => {
  const navigate = useNavigate();
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    partnershipGoal: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSearchParams((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log("Search params:", searchParams);
  };

  return (
    <div className="min-h-screen relative">
      {/* 背景图片 */}
      <div className="absolute inset-0 z-0">
        <img
          src={heroBg}
          alt="Background"
          className="w-full h-full object-cover"
          style={{
            filter: "brightness(0.7) saturate(0.8) hue-rotate(190deg)",
          }}
        />
        <div className="absolute inset-0 bg-cyan-900/30 mix-blend-multiply" />
      </div>

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 z-10 text-white hover:text-cyan-100 transition-colors duration-200"
      >
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 flex flex-col items-center justify-center min-h-screen px-4 py-12">
        <h1 className="text-5xl font-light text-white mb-12 tracking-wide">
          Let's Find Your Perfect Partner
        </h1>

        <form
          onSubmit={handleSubmit}
          className="w-full max-w-3xl bg-white/10 backdrop-blur-lg rounded-2xl p-8 shadow-2xl"
        >
          <div className="grid gap-6">
            {/* Location */}
            <div className="relative">
              <label
                htmlFor="location"
                className="block text-sm font-medium text-white mb-2"
              >
                Location
              </label>
              <input
                type="text"
                id="location"
                name="location"
                value={searchParams.location}
                onChange={handleChange}
                placeholder="Enter city or region"
                className="w-full px-4 py-3 bg-white/80 backdrop-blur-sm rounded-lg border-0 focus:ring-2 focus:ring-cyan-400 transition-all duration-200"
              />
            </div>

            {/* Organization Type */}
            <div className="relative">
              <label
                htmlFor="orgType"
                className="block text-sm font-medium text-white mb-2"
              >
                Organization Type
              </label>
              <select
                id="orgType"
                name="orgType"
                value={searchParams.orgType}
                onChange={handleChange}
                className="w-full px-4 py-3 bg-white/80 backdrop-blur-sm rounded-lg border-0 focus:ring-2 focus:ring-cyan-400 transition-all duration-200"
              >
                <option value="">Select organization type</option>
                <option value="nonprofit">Nonprofit</option>
                <option value="forprofit">For-Profit</option>
                <option value="social">Social Enterprise</option>
                <option value="government">Government</option>
              </select>
            </div>

            {/* Partnership Goal */}
            <div className="relative">
              <label
                htmlFor="partnershipGoal"
                className="block text-sm font-medium text-white mb-2"
              >
                What Kind of Organization Are You Looking For?
              </label>
              <textarea
                id="partnershipGoal"
                name="partnershipGoal"
                value={searchParams.partnershipGoal}
                onChange={handleChange}
                placeholder="Describe your ideal partnership..."
                rows="4"
                className="w-full px-4 py-3 bg-white/80 backdrop-blur-sm rounded-lg border-0 focus:ring-2 focus:ring-cyan-400 transition-all duration-200 resize-none"
              />
            </div>

            {/* Search Button */}
            <button
              type="submit"
              className="w-full bg-cyan-500 hover:bg-cyan-600 text-white font-medium py-3 px-6 rounded-lg transition-colors duration-200 mt-4"
            >
              Search Partners
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default PartnershipSearch;
